import axios from 'axios';
import { useState } from 'react';
import { MainContainer } from '../styles/StyledStore';
/**
 * # QuestionList
 *
 * ## init
 *
 * @KimTank
 *
 * ## modified
 *
 * @TODO
 *
 * ## description
 *
 * - 질문 리스트
 * - nested route(중첩 라우트로 목록눌렀을 때 상세로 이동)
 *
 * @returns QuestionList
 */
function Temp() {
  const [data, setData] = useState([]);

  userEffect
  axios
    .get('/board/posts', {
      withCredentials: true,
      params: {
        page: 1,
        size: 10,
      },
    })
    .then((response) => {
      const { data } = response;
      console.log(data.data);
      setData(data.data);
    })
    .catch((error) => alert(error));

  return (
    <MainContainer>
      <ul>
        {data.length === 0 ? (
          <li>not empty</li>
        ) : (
          data.map((data, index) => <li key={index}>{data.title}</li>)
        )}
      </ul>
    </MainContainer>
  );
}

export default Temp;
